import React from "react";

export default function FirstColumn() {
    return (
        <div className="info">
            <p></p>
            <p>Up</p>
            <p>Down</p>
            <p>OK</p>
            <p>Warning</p>
            <p>Critical</p>


        </div>
    );
}
